<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\Master\Tenant\Domain\TenantRef;
use Civi\Lughauth\Features\Access\Master\RelyingParty\Domain\RelyingPartyRef;
use Civi\Lughauth\Features\Access\Master\TenantPartySecurity\Domain\ValueObject\TenantPartySecurityTenantVO;
use Civi\Lughauth\Features\Access\Master\TenantPartySecurity\Domain\ValueObject\TenantPartySecurityRelyingPartyVO;
use Civi\Lughauth\Features\Access\Master\TenantPartySecurity\Domain\ValueObject\TenantPartySecurityPoliciesVO;
use Civi\Lughauth\Features\Access\Master\TenantPartySecurity\Domain\ValueObject\TenantPartySecurityVersionVO;
use Civi\Lughauth\Features\Access\Master\TenantPartySecurity\Application\Usecase\Retrieve\TenantPartySecurityRetrieveResult;
use PHPUnit\Framework\TestCase;

final class TenantPartySecurityRetrieveResultUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new TenantPartySecurityRetrieveResult();
        $tenantOneValue = new TenantRef('one');
        $tenantOtherValue = new TenantRef('other');
        $copy = $value->tenant($tenantOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(new TenantRef('one'), $value->getTenant());
        $this->assertNotEquals(new TenantRef('other'), $value->getTenant());
        $this->assertEquals(new TenantRef('one'), $value->getTenantOrDefault(TenantPartySecurityTenantVO::from($tenantOtherValue))->value());
        $this->assertNotEquals(new TenantRef('other'), $value->getTenantOrDefault(TenantPartySecurityTenantVO::from($tenantOtherValue))->value());
        $value->unsetTenant();
        $this->assertEquals(new TenantRef('other'), $value->getTenantOrDefault(TenantPartySecurityTenantVO::from($tenantOtherValue))->value());
        $this->assertNotEquals(new TenantRef('one'), $value->getTenantOrDefault(TenantPartySecurityTenantVO::from($tenantOtherValue))->value());
        $relyingPartyOneValue = new RelyingPartyRef('one');
        $relyingPartyOtherValue = new RelyingPartyRef('other');
        $copy = $value->relyingParty($relyingPartyOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(new RelyingPartyRef('one'), $value->getRelyingParty());
        $this->assertNotEquals(new RelyingPartyRef('other'), $value->getRelyingParty());
        $this->assertEquals(new RelyingPartyRef('one'), $value->getRelyingPartyOrDefault(TenantPartySecurityRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $this->assertNotEquals(new RelyingPartyRef('other'), $value->getRelyingPartyOrDefault(TenantPartySecurityRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $value->unsetRelyingParty();
        $this->assertEquals(new RelyingPartyRef('other'), $value->getRelyingPartyOrDefault(TenantPartySecurityRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $this->assertNotEquals(new RelyingPartyRef('one'), $value->getRelyingPartyOrDefault(TenantPartySecurityRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $policiesOneValue = 'one';
        $policiesOtherValue = 'other';
        $copy = $value->policies($policiesOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getPolicies());
        $this->assertNotEquals('other', $value->getPolicies());
        $this->assertEquals('one', $value->getPoliciesOrDefault(TenantPartySecurityPoliciesVO::from($policiesOtherValue))->value());
        $this->assertNotEquals('other', $value->getPoliciesOrDefault(TenantPartySecurityPoliciesVO::from($policiesOtherValue))->value());
        $value->unsetPolicies();
        $this->assertEquals('other', $value->getPoliciesOrDefault(TenantPartySecurityPoliciesVO::from($policiesOtherValue))->value());
        $this->assertNotEquals('one', $value->getPoliciesOrDefault(TenantPartySecurityPoliciesVO::from($policiesOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(TenantPartySecurityVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(TenantPartySecurityVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(TenantPartySecurityVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(TenantPartySecurityVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
